import './BoutiqueMenu.css'

export default function BoutiqueMenu() {
  return (
    <div>
      <div className="container">
        <div class="item">Bonnet</div>
        <div class="item">Tour de cou</div>
        <div class="item">Pull</div>
        <div class="item">Gant</div>
        <div class="item">Chaussette</div>
        <div class="item">Plaide</div>
        <div class="item">Pelote</div>
      </div>
    </div>
  );
}
